g2:c.METHOD.g2:a.TEXT:
register-attributes-for-monitor-on-queue (ViewManager: class remote-queue-event-manager {The manager which is to monitor the items.}, AttributeSequence: sequence{a sequence of symbols (attribute names or attribute keys) naming the items to be monitored. There should not be duplicated symbols in this sequence})
{Attribute monitoring is configurable per client.  Therefore, when a browser needs a set of attributes to be monitored, these need to be registered with the client.}
Client: class g2-window = gfr-default-window {Could a remote client be extracted from the ViewManager?};
AttributeList: class symbol-list = the _grl-monitored-attributes of ViewManager;
AttributeName: symbol;
AttributeSequenceStatic: sequence = AttributeSequence;
I: integer = 0;
Queue: class gqs-queue;
ItemSequence: sequence;
MonitoredItem: class item;
AttributeCallback: symbol = the symbol _grl-attribute-callback;
begin
{First, set up attributes on Manager}
    if the _grl-is-active-monitoring of ViewManager then for AttributeName = each symbol in AttributeSequenceStatic do
        if AttributeName is not a member of AttributeList then begin
            insert AttributeName at the end of AttributeList;
            I = I + 1;
        end else AttributeSequence = remove (AttributeSequence, I);  {At this point we could track in a sequence the number of listeners which have registered for a given attribute name.  This would allow listeners to deregister  - gbs}
    end else begin
        conclude that the _grl-is-active-monitoring of ViewManager = true;
        conclude that the g2-list-sequence of AttributeList = AttributeSequence;
    end;
{Then register all existing items on the manager}   
    if the number of elements in AttributeSequence = 0 then return;
    Queue = the gqs-queue that is gqs-queue-being-viewed-by ViewManager; 
    ItemSequence = grl-get-queue-contents-sequence (Queue);
    for MonitoredItem = each item in ItemSequence do
        for AttributeName = each symbol in AttributeSequence do
            call gens-monitor-attribute-changes (MonitoredItem, ViewManager, AttributeName, AttributeCallback, false {SignalErrors flag}, Client);
        end;
    end;
end

remove-items-from-queue (ViewManager: class remote-queue-event-manager {The manager associated with the queue from which the items are to be removed.}, DeleteSequence: sequence{the sequence of items which are to be removed from the Queue})
{This allows a remote listener for a queue to remove items from that queue given only the Manager through which it is communicating to the queue.}
Client: class g2-window = gfr-default-window {Could a remote client be extracted from the ViewManager?};
Queue: class gqs-queue;
DeleteList: class item-list;
begin
    create an item-list DeleteList;
    conclude that the g2-list-sequence of DeleteList = DeleteSequence;
    Queue = the gqs-queue that is gqs-queue-being-viewed-by ViewManager;
    call gqs-remove-items(Queue, DeleteList, Client); {At this point, gqs-remove-items will not clean up the removed items, but it should (otherwise the client has to worry about it).  See GDA's implementation.}
end

remove-remote-queue-event-listener (ViewManager: class remote-queue-event-manager {The manager which is notifying Listener}, Listener: class remote-queue-event-listener {The listener in the remote system which is no longer meant to be notified of changes})
{This API should be called to remove a Listener from a ViewManager.  If there are no other Listeners for ViewManager, ViewManager will be deleted.}
ListenerList: class item-list; 
Queue : class gqs-queue;
begin
    call remove-g2-event-listener (ViewManager, Listener);
    ListenerList = call get-event-listener-list (ViewManager);
    if the number of elements in ListenerList = 0 then begin
        Queue = the gqs-queue that is gqs-queue-being-viewed-by ViewManager;
        call gqs-deregister-view (Queue, ViewManager, gfr-default-window);
        delete ViewManager;
    end;
end

add-remote-queue-event-listener (ViewManager: class remote-queue-event-manager {The manager which is to notify Listener}, Listener: class remote-queue-event-listener {The listener in the remote system which will be notified of changes})
{This API should be called from a remote browser when that brower wishes to listen to change events on a queue.  The proper manager for this call can be obtained by calling gqs-queue::get-queue-manager.  Listener is added to as an event listener to the manager and the manager is registered with Queue.  Finally, an event is returned to the Listener giving the initial state of the Queue}
Event: class remote-queue-event;
begin
    call add-g2-event-listener (ViewManager, Listener);
    {pbk: we are currently making the client reponsible for getting the initial state
      Event = call _grl-create-initial-state-event(ViewManager);
    call queue-received-initial-state(Listener, Event);
    delete Event;}
end

get-queue-manager (Queue: class gqs-queue {The queue about which the Listener wishes to be notified}) = (class remote-queue-event-manager)
{This API should be called from a remote browser when needs a manager for a given queue.  This method is implemented on gqs-queue, but only in the grl module.  It will create a view manager by calling gqs-launch-view on the queue.  Assuming that the Queue uses the proper structure for defining a view tempate, an instance or subclass of remote-queue-event-manager should be created or found.}
ViewManager: class remote-queue-event-manager;
ManagerSequence: sequence = grl-get-queue-contents-sequence (Queue);
begin
    if there exists a remote-queue-event-manager ViewManager that is gqs-view-manager-for-queue Queue then return ViewManager;
    create a remote-queue-event-manager ViewManager; 
    call gqs-register-view (Queue, ViewManager, gfr-default-window);
    return ViewManager;
end

grl-batch-update-view-per-attribute (Manager: class remote-queue-event-manager {the manager to be updated}, Queue: class gqs-queue {the underlying queue}, MonitoredItemSequence: sequence {A sequence containing the items whose attribute has changed}, Attribute: symbol {the name of the attribute})
{This is method adds to the basic update view per attribute method.  This method can be called when a large number of items have a single attribute updated.  This method can be extended, but should never be called directly. <p>
The purpose of this method is to accomplish a large number of item changes with only a single call to a remote view <p>
The listener is notified via the method node-state-changed.  The event passed to Listener will have the remote-queue-event-data with containing a remote-queue-event-type of ATTRIBUTE-UPDATE (see remote-queue-event).  Additionally, the remote-queue-event-data of the remote-queue-event will contain an attribute monitored-attribute-name, which will be a symbol giving the attribute name or key which designates the attribute that has changed.}  
ListenerList: class item-list;
Listener: class remote-queue-event-listener;
ListenerError: class error;
Event: class remote-queue-event;
begin
    ListenerList = call get-event-listener-list (Manager);
    Event = call g2-event-create-event(remote-queue-event, Queue);
    conclude that the remote-queue-event-data of Event = structure (remote-queue-event-type: the symbol ATTRIBUTE-UPDATE, remote-queue-event-list: MonitoredItemSequence, monitored-attribute-name: Attribute);
    for Listener = each remote-queue-event-listener in ListenerList do
            begin call queue-items-attribute-changed (Listener, Event);
        end on error(ListenerError)
            { Obviously it is not behaving, so remove it from listener list}
            call remove-g2-event-listener (Manager, Listener);
            signal ListenerError;
        end;
    end; 
    delete Event;
end

g2:c.PROCEDURE.g2:a.TEXT:
_grl-attribute-callback(Manager: class remote-queue-event-manager, MonitoredItem: class item, Attribute: symbol) 
{This procedure duplicates _gqsv-attribute-callback, but takes a manager of the correct class}
begin
    if Manager does not exist or MonitoredItem does not exist then return;
    if there exists a gqs-queue Queue that is gqs-queue-being-viewed-by Manager then call gqs-update-view-per-attribute (Manager, Queue, MonitoredItem, Attribute);
end

_grl-create-initial-state-event(ViewManager: class remote-queue-event-manager) = (class remote-queue-event)
QContents: Sequence;
Queue : class gqs-queue;
Event: class remote-queue-event;
begin 
    Queue = the gqs-queue that is gqs-queue-being-viewed-by ViewManager; 
    Event = call g2-event-create-event(remote-queue-event, Queue);
    conclude that the remote-queue-event-data of Event = structure (remote-queue-event-type: the symbol NEW-STATE, remote-queue-event-list: grl-get-queue-contents-sequence(Queue));
     return Event;
end

