_grl-collect-classes (TargetModules: sequence {the modules in which to search for class definitions}, Client: class object {the client for this call}) = (class item-list {a list containing documentable class definitions})
{This procedure collects the documentable class definitions by calling the protools procedure.  It also look for at a symbol array to collect any additional class definitions required for cross-reference purposes .}
Defs: class item-list;
Def: class class-definition;
DefNameArray: class symbol-array = _grl-cross-referenced-classes; 
DefName: symbol;
AddlDef: class class-definition;
DLength: integer = the array-length of DefNameArray - 1;
I: integer; 
PTCollectClassDefs: symbol = the symbol protools-collect-class-definitions;
begin
    if the procedure named by PTCollectClassDefs exists then begin
        Defs = call the procedure named by PTCollectClassDefs (TargetModules, Client); 
        for I = 0 to DLength do
            DefName = DefNameArray[I];
            if the class-definition AddlDef named by DefName exists then insert AddlDef at the end of Defs
        end;
    end
    else
        create an item-list Defs;
    return Defs;
end

_grl-collect-API-procedures(TargetModules: sequence {the modules in which to search for primary procedures}, Client: class object {the client for this call}) = (class item-list {a list of methods and procedures that will be documented})
{This procedure calls the protools procedure to collect the documentable procedures and method contained in the target modules.  In addition, it will look for at a symbol array to collect any additional procedure required for cross-reference purposes.} 
Procs: class item-list;
Proc: class procedure;
ProcNameArray: class symbol-array = _grl-cross-referenced-procedures;
ProcName: symbol;
AddlProc: class procedure;
PLength: integer = the array-length of ProcNameArray - 1;
ProtoolsCollectMeth: symbol = the symbol protools-collect-api-procedures;
I: integer;
begin
    if the procedure named by ProtoolsCollectMeth exists then begin
        Procs = call the procedure named by ProtoolsCollectMeth (TargetModules, Client);
        for I = 0 to PLength do
            ProcName = ProcNameArray[I];
            if the procedure AddlProc named by ProcName exists then insert AddlProc at the end of Procs
        end;
    end
    else
        create an item-list Procs;
    return Procs;
end

g2:c.METHOD.g2:a.TEXT:
gqs-update-view-per-addition(Manager: class remote-queue-event-manager {the manager to be updated}, Queue: class gqs-queue {the underlying queue} , Items: class item-list {the list of items added to the queue},  Client: class ui-client-item {the client for this call})
{This is method extends required method of the class gqs-view-manager.  This method is called to update the view in response to one or more items being added to the queue.  This method can be extended, but should never be called directly.  When a gqs-queue which notifies Manager of the addition of items to the queue, this method will pass that event on to any of its listeners (see gqs-queue:add-remote-listener).  <p>
This method should never be called either by the user-written KB code or by the remote browser itself.<p>
The listener is notified via the method node-state-changed.  The event passed to Listener will have the remote-queue-event-data with containing a remote-queue-event-type of ADDITION(see remote-queue-event).  Additionally, if the listener has registered attributes to be monitored, this procedure begins the montoring of those attributes on the new items.} 
ListenerList: class item-list;
Listener: class remote-queue-event-listener;
Event: class remote-queue-event;
ListenerError: class error;
MonitoredItem: class item;
AttributeName: symbol;
begin
    for AttributeName = each symbol in the _grl-monitored-attributes of Manager do 
        for MonitoredItem = each item in Items do
            call gens-monitor-attribute-changes (MonitoredItem, Manager, AttributeName, the symbol _grl-attribute-callback, false {SignalErrors flag}, Client);
        end;
    end; 
    ListenerList = call get-event-listener-list (Manager);
    Event = call g2-event-create-event(remote-queue-event, Queue);
    conclude that the remote-queue-event-data of Event = structure (remote-queue-event-type: the symbol ADDITION, remote-queue-event-list: the g2-list-sequence of Items);
    for Listener = each remote-queue-event-listener in ListenerList do
        begin 
            call queue-items-added(Listener, Event);
        end on error(ListenerError)
            { Obviously it is not behaving, so remove it from listener list}
            call remove-g2-event-listener (Manager, Listener);
        end;
    end; 
    delete Event;
end

gqs-update-view-per-removal(Manager: class remote-queue-event-manager {the manager to be updated}, Queue: class gqs-queue {the underlying queue} , Items: class item-list {the list of items removed from the queue},  Client: class ui-client-item {the client for this call})
{This is method extends required method of the class gqs-view-manager.  This method is called to update the view in response to one or more items being removed from the queue.  This method can be extended, but should never be called directly.  When a gqs-queue which notifies Manager of the removal of items to the queue, this method will pass that event on to any of its listeners (see gqs-queue:add-remote-listener).  <p>
This method should never be called either by the user-written KB code or by the remote browser itself.<p>
The listener is notified via the method node-state-changed.  The event passed to Listener will have the remote-queue-event-data with containing a remote-queue-event-type of REMOVAL (see remote-queue-event).}  

ListenerList: class item-list;
Listener: class remote-queue-event-listener;
Event: class remote-queue-event;
ListenerError: class error;
RemovedItem: class item;
begin
    if the _grl-is-active-monitoring of Manager then for RemovedItem = each item in Items do call gens-cancel-all-attribute-monitors (RemovedItem, Manager, Client); end;
    ListenerList = call get-event-listener-list (Manager);
    Event = call g2-event-create-event (remote-queue-event, Queue);
    conclude that the remote-queue-event-data of Event = structure (remote-queue-event-type: the symbol REMOVAL, remote-queue-event-list: the g2-list-sequence of Items);
    for Listener = each remote-queue-event-listener in ListenerList do
        begin 
            call queue-items-removed(Listener, Event);
        end on error(ListenerError)
            { Obviously it is not behaving, so remove it from listener list}
            call remove-g2-event-listener (Manager, Listener);
        end;
    end; 
    delete Event;

end

