            signal ListenerError;
        end;
    end; 
    delete Event;
end

gqs-update-view-per-delete (Manager: class remote-queue-event-manager {the manager to be updated}, Queue: class gqs-queue {the underlying queue}, Client: class ui-client-item {the client for this call})
{This is method extends required method of the class gqs-view-manager.  This method is called to update the view in response to one or more items being deleted from the queue.  This method can be extended, but should never be called directly.  When a gqs-queue which notifies Manager of the deletion of items to the queue, this method will pass that event on to any of its listeners (see gqs-queue:add-remote-listener).  <p>
This method should never be called either by the user-written KB code or by the remote browser itself.<p>
The listener is notified via the method node-state-changed.  The event passed to Listener will have the remote-queue-event-data with containing a remote-queue-event-type of INVALIDATE-STATE (see remote-queue-event).}
ListenerList: class item-list;
Listener: class remote-queue-event-listener;
Event: class remote-queue-event;
ListenerError: class error;
Items: sequence = grl-get-queue-contents-sequence (Queue);
begin
    {Queue state damaged, resend entire queue state}
    ListenerList = call get-event-listener-list (Manager);
    Event = call g2-event-create-event (remote-queue-event, Queue);
    conclude that the remote-queue-event-data of Event = structure (remote-queue-event-type: the symbol INVALIDATE-STATE, remote-queue-event-list: Items);
    for Listener = each remote-queue-event-listener in ListenerList do
        begin
            call queue-invalidate-state (Listener, Event);
        end on error (ListenerError)
            { Obviously it is not behaving, so remove it from listener list.  Other error handling?} 
            call remove-g2-event-listener (Manager, Listener);
        end;
    end;
    delete Event;
end

gqs-create-view (Template: class remote-queue-event-manager-template {The method which creates a manager for remote views}, Queue: class gqs-queue {the queue that requires a view}, Client: class ui-client-session {the remote client for this call}) = (class remote-queue-event-manager {a new remote view manager that manages the interaction between a queue and one or more remote browsers})
{This method finds the remote-queue-event-manager for the given queue and client, if one exists.  If not the method creates one.  This method can be extended.<p>

To create a view manager via the API, the users can call GQS-LAUNCH-VIEW passing a the Queue for which the manager is desired and a remote client.<p>

In general, user-written code will not call this procedure.  For direct access (from the client side) they can call get-Remote-Manager, a method on queue, to create or find a Manager and then register the client as a listener.}
Manager: class remote-queue-event-manager;
begin
{No call next method.  Superior signals an error}
    Manager =call get-queue-manager(Queue);
    return Manager;
end
